import './App.css';


async function getExp(stlvl,endlvl,type){
  await fetch('/exp/'+stlvl+'/'+endlvl+'/'+type)
  .then(response => response.json())
  .then(data => console.log(data.exp));

}

function App() {


  return (
    <div className="container mx-auto flex px-20 py-24 md:flex-row flex-col items-center">


      <input  class="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500"type="number" id="stlvl"></input>
      <input class="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500"type="number" id="endlvl"></input>

      <select id = "type">
        <option value="NONE">NONE</option>
        <option value="MEGA">MEGA</option>
        <option value="TERA">TERA</option>
        <option value="HYPER">HYPER</option>
      </select>
      <button class="bg-gray-300 hover:bg-gray-400 text-gray-800 font-bold py-2 px-4 rounded inline-flex items-center" onClick={() => getExp(document.getElementById("stlvl").value,document.getElementById("endlvl").value,document.getElementById("type").value).innerHTML}> 

      Get Exp
    </button>



    </div>
  );
}

export default App;
